import React from 'react';
import { useSelector } from 'react-redux';

import { Container, Title } from './style';

const OrderForm = () => {
    const { step } = useSelector(state => state.order);

    return (
        <Container>
            <Title>
                주문하기
            </Title>
            {step === 1 
            ? <DinnerSelectForm />
            : <div></div>}

        </Container>
    );
};

export default OrderForm;
